        static IOrganizationService ConnectToCRM(string connectionString)
        {
            IOrganizationService service = null;
            try
            {
                service = new CrmServiceClient(connectionString);
                if (((CrmServiceClient)service).LastCrmException != null && (((CrmServiceClient)service).LastCrmException.Message == "OrganizationWebProxyClient is null" ||
                    ((CrmServiceClient)service).LastCrmException.Message == "Unable to Login to Dynamics CRM"))
                {
                    Console.WriteLine(((CrmServiceClient)service).LastCrmException.Message);
                    throw new Exception(((CrmServiceClient)service).LastCrmException.Message);
                }
            }
            catch (Exception ex)
            {
                Console.WriteLine("Error while Creating Conn: " + ex.Message);
            }
            return service;

        }

        static void jobsheetFromAPI(IOrganizationService service, string jobID, string logingUserID)
        {
            IntegrationConfiguration inconfig = GetIntegrationConfiguration(service);

            String sUrl = "http://10.199.6.42:8089/api/GetD365ArchivedData?" + "RefId=" + jobID + "&entityNo=4&ApiType=4";
            //inconfig.url + "RefId=" + jobID + "&entityNo=4&ApiType=4";
            Console.WriteLine("API URL= " + sUrl);
            String sUserName = inconfig.userName;
            string sPassword = inconfig.password;
            string credentials = Convert.ToBase64String(Encoding.ASCII.GetBytes(sUserName + ":" + sPassword));

            var client = new RestClient(sUrl);
            client.Timeout = -1;
            var request = new RestRequest(Method.GET);
            request.AddHeader("Authorization", "Basic " + credentials);
            IRestResponse response = client.Execute(request);
            Console.WriteLine(response.Content);

            JobResponseAPI rootObject = new JobResponseAPI();
            rootObject = JsonConvert.DeserializeObject<JobResponseAPI>(response.Content);

            //DataContractJsonSerializer ser = new DataContractJsonSerializer(typeof(JobAPIResponse));
            //JobAPIResponse rootObject = (JobAPIResponse)ser.ReadObject(new MemoryStream(jsonData));
            if (rootObject.success)
            {
                foreach (WorkOrder workOrder in rootObject.workOrders)
                {
                    if (workOrder.job.Count > 0)
                        GenrateJobSheetFormModel(workOrder, service, logingUserID);
                }
            }
        }
