        static void jobSheetFromDynamcics(IOrganizationService service, string jobId)
        {
            string fetchXML = @"<fetch version='1.0' output-format='xml-platform' mapping='logical' distinct='false'>
                                  <entity name='msdyn_workorder'>
                                    <attribute name='msdyn_workorderid' />
                                    <attribute name='hil_productcategory' />
                                    <attribute name='hil_productcatsubcatmapping' />
                                    <attribute name='hil_pincode' />
                                    <attribute name='ownerid' />
                                    <attribute name='hil_mobilenumber' />
                                    <attribute name='msdyn_name' />
                                    <attribute name='hil_fulladdress' />
                                    <attribute name='hil_customerref' />
                                    <attribute name='hil_jobclosuredon' />
                                    <attribute name='hil_callingnumber' />
                                    <attribute name='hil_countryclassification' />
                                    <attribute name='hil_observation' />
                                    <attribute name='msdyn_primaryincidenttype' />
                                    <order attribute='hil_productcategory' descending='false' />
                                    <filter type='and'>
                                      <condition attribute='msdyn_workorderid' operator='eq' uiname='13012212673872' uitype='msdyn_workorder' value='{" + jobId + @"}' />
                                    </filter>
                                    <link-entity name='msdyn_customerasset' from='msdyn_customerassetid' to='msdyn_customerasset' visible='false' link-type='outer' alias='customerAsset'>
                                      <attribute name='hil_warrantystatus' />
                                      <attribute name='hil_purchasedfrom' />
                                      <attribute name='msdyn_name' />
                                      <attribute name='msdyn_product' />
                                      <attribute name='hil_modelname' />
                                      <attribute name='hil_invoiceno' />
                                      <attribute name='hil_invoicedate' />
                                    </link-entity>
                                  </entity>
                                </fetch>";
            EntityCollection jobColl = service.RetrieveMultiple(new FetchExpression(fetchXML));
            WorkOrder workOrder = new WorkOrder();
            List<Job> joblist = new List<Job>();
            foreach (Entity job in jobColl.Entities)
            {
                Job _job = new Job();
                _job.alternateNumber = job.Contains("hil_callingnumber") ? job.GetAttributeValue<string>("hil_callingnumber") : "";
                _job.mobileNumber = job.Contains("hil_mobilenumber") ? job.GetAttributeValue<string>("hil_mobilenumber") : "";
                _job.jobNumber = job.Contains("msdyn_name") ? job.GetAttributeValue<string>("msdyn_name") : "";
                _job.fullAddress = job.Contains("hil_fulladdress") ? job.GetAttributeValue<string>("hil_fulladdress") : "";
                _job.countryClassification = job.Contains("hil_countryclassification") ? job.GetAttributeValue<OptionSetValue>("hil_countryclassification").Value.ToString() : "";
                _job.customerName = job.Contains("hil_customerref") ? job.GetAttributeValue<EntityReference>("hil_customerref").Name : "";
                _job.pincode = job.Contains("hil_pincode") ? job.GetAttributeValue<EntityReference>("hil_pincode").Name : "";
                _job.productSubCategory = job.Contains("hil_productcatsubcatmapping") ? job.GetAttributeValue<EntityReference>("hil_productcatsubcatmapping").Name : "";
                _job.productCategory = job.Contains("hil_productcategory") ? job.GetAttributeValue<EntityReference>("hil_productcategory").Name : "";
                _job.VisitDate = job.Contains("hil_jobclosuredon") ? job.GetAttributeValue<DateTime>("hil_jobclosuredon").Date.ToString() : "";
                // incidentData.purchasedFrom = job.Contains("customerAsset.hil_purchasedfrom") ? job.GetAttributeValue<AliasedValue>("customerAsset.hil_purchasedfrom").Value.ToString() : "";
                _job.jonWarranty = job.Contains("customerAsset.hil_warrantystatus") ? ((OptionSetValue)job.GetAttributeValue<AliasedValue>("customerAsset.hil_warrantystatus").Value).Value.ToString() : "";
                joblist.Add(_job);

            }
        }
        static void GenrateJobSheetFormModel(WorkOrder workOrder, IOrganizationService service, string logingUserID)
        {
            QueryExpression query = new QueryExpression("contact");
            query.ColumnSet = new ColumnSet(false);
            query.Criteria = new FilterExpression(LogicalOperator.And);
            query.Criteria.AddCondition("mobilephone", ConditionOperator.Equal, workOrder.job[0].mobileNumber);
            EntityReference customerColl = service.RetrieveMultiple(query)[0].ToEntityReference();
            string blobURL = genratejobSheet(workOrder, service);
            Console.WriteLine("Blob URL for Job " + workOrder.job[0].jobNumber + " URL:- " + blobURL);
            string Subject = "Job Sheet is Created for Job: " + workOrder.job[0].jobNumber;
            string mailbody = @"Hi There,<br>Job Sheet is Created for Job: " + workOrder.job[0].jobNumber + " please <a href='" + blobURL + @"' target='_blank'>Click Here</a> to download.";
            sendEmail(service, mailbody, Subject, new EntityReference("systemuser", new Guid(logingUserID)), customerColl);
        }
        static string genratejobSheet(WorkOrder workOrder, IOrganizationService service)
        {
            string fileName = "TCR_" + workOrder.job[0].jobNumber + ".pdf";
            Pechkin.GlobalConfig gc = new Pechkin.GlobalConfig();
            gc.SetMargins(new Margins(0, 0, 0, 0))
                .SetDocumentTitle(fileName)
                .SetPaperSize(PaperKind.A4);

            var oc = new ObjectConfig();
            oc.SetPrintBackground(true)
            .SetAllowLocalContent(true);

            IPechkin pechkin = new SynchronizedPechkin(gc);

            ObjectConfig configuration = new ObjectConfig();

            configuration
            .SetAllowLocalContent(true)
            .SetPrintBackground(true)
            .SetAllowLocalContent(true);

            byte[] pdfContent = pechkin.Convert(configuration, htmlCodefromModel(workOrder, service));
            String blobURL = Upload(fileName, pdfContent, "crm-blobs");
            return blobURL;
        }
        static string ToURLSlug(string s)
        {
            return Regex.Replace(s, @"[^a-z0-9]+", "-", RegexOptions.IgnoreCase)
                .Trim(new char[] { '-' })
                .ToLower();
        }
        static string Upload(string fileName, byte[] fileContent, string containerName)
        {
            string _blobURI = string.Empty;
            try
            {
                //byte[] fileContent = Convert.FromBase64String(noteBody);
                string ConnectionSting = "DefaultEndpointsProtocol=https;AccountName=d365storagesa;AccountKey=6zw5Lx4X+zHrh+CAKLdgaWSqVZ1zC7AKugPkNEGevep6qhh1xRm5Q3DBWKGJ+DsWfCZk59BbLSJvja81DD4++w==;EndpointSuffix=core.windows.net";
                // create object of storage account
                CloudStorageAccount storageAccount = CloudStorageAccount.Parse(ConnectionSting);

                // create client of storage account
                CloudBlobClient client = storageAccount.CreateCloudBlobClient();

                // create the reference of your storage account
                CloudBlobContainer container = client.GetContainerReference(ToURLSlug(containerName));

                // check if the container exists or not in your account
                var isCreated = container.CreateIfNotExists();

                // set the permission to blob type
                container.SetPermissionsAsync(new BlobContainerPermissions
                { PublicAccess = BlobContainerPublicAccessType.Blob });

                // create the memory steam which will be uploaded
                using (MemoryStream memoryStream = new MemoryStream(fileContent))
                {
                    // set the memory stream position to starting
                    memoryStream.Position = 0;

                    // create the object of blob which will be created
                    // Test-log.txt is the name of the blob, pass your desired name
                    CloudBlockBlob blob = container.GetBlockBlobReference(fileName);

                    // get the mime type of the file
                    string mimeType = "application/unknown";
                    string ext = (fileName.Contains(".")) ?
                                System.IO.Path.GetExtension(fileName).ToLower() : "." + fileName;
                    Microsoft.Win32.RegistryKey regKey =
                                Microsoft.Win32.Registry.ClassesRoot.OpenSubKey(ext);
                    if (regKey != null && regKey.GetValue("Content Type") != null)
                        mimeType = regKey.GetValue("Content Type").ToString();

                    // set the memory stream position to zero again
                    // this is one of the important stage, If you miss this step, 
                    // your blob will be created but size will be 0 byte
                    memoryStream.ToArray();
                    memoryStream.Seek(0, SeekOrigin.Begin);

                    // set the mime type
                    blob.Properties.ContentType = mimeType;

                    // upload the stream to blob
                    blob.UploadFromStream(memoryStream);
                    _blobURI = blob.Uri.AbsoluteUri;
                }

            }
            catch (Exception ex)
            {
                throw new Exception("JobSheet.JobSheet.Upload: " + ex.Message);
            }
            return _blobURI;
        }
        static void sendEmail(IOrganizationService _service, string mailbody, string subject, EntityReference owner, EntityReference regarding)
        {
            try
            {
                Entity entEmail = new Entity("email");
                Entity entFrom = new Entity("activityparty");
                entFrom["partyid"] = new EntityReference("queue", new Guid("9B0480A8-E30F-E911-A94E-000D3AF06A98"));
                Entity[] entFromList = { entFrom };
                entEmail["from"] = entFromList;
                EntityReference to = owner;
                Entity toActivityParty = new Entity("activityparty");
                toActivityParty["partyid"] = to;
                entEmail["to"] = new Entity[] { toActivityParty };
                entEmail["subject"] = subject;
                entEmail["description"] = mailbody;
                entEmail["regardingobjectid"] = regarding;
                Guid emailId = _service.Create(entEmail);
                SendEmailRequest sendEmailReq = new SendEmailRequest()
